CREATE DATABASE symfony; 
USE `symfony`;
SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
START TRANSACTION;
SET time_zone = "+00:00";

CREATE TABLE `doctrine_migration_versions` (
 `version` varchar(191) COLLATE utf8_unicode_ci NOT NULL,
 `executed_at` datetime DEFAULT NULL,
 `execution_time` int(11) DEFAULT NULL,
 PRIMARY KEY (`version`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

CREATE TABLE `rapports` (
 `id` int(11) NOT NULL AUTO_INCREMENT,
 `date` datetime NOT NULL,
 `region` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
 `vendeur` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
 `montant` double NOT NULL,
 PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3971 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `regions` (
 `id` int(11) NOT NULL AUTO_INCREMENT,
 `region` varchar(255) NOT NULL,
 PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8mb4;

CREATE TABLE `user` (
 `id` int(11) NOT NULL AUTO_INCREMENT,
 `nom` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
 `prenom` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
 `email` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
 `password` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
 `token` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
 `valid` tinyint(1) NOT NULL,
 PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `vendeurs` (
 `id` int(11) NOT NULL AUTO_INCREMENT,
 `vendeur` varchar(255) NOT NULL,
 PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=199 DEFAULT CHARSET=utf8mb4;



COMMIT;